description:
6 Freedom est une start-up fondée en 2019 et spécialisée dans l’AR/VR*;

Nous utilisons notre expertise dans les usages des technologies AR,VR,MR pour créer des outils qui optimisent les activités de nos clients (+30 projets); 

Pour cela nous avons deux approches : 

1-Approche opérationnelle pour ceux qui connaissent l’AR/VR
2-Approches conseil pour ceux qui souhaitent être accompagnés dans leur approche de l ’AR/VR
